	add("celebutard", "{\"term\":\"celebutard\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{blend|celebrity|debutante|retard|lang\u003den}}.\u0026lt;ref\u0026gt;\u0026quot;[http://news.bbc.co.uk/2/hi/5396866.stm New insults for English language]\u0026quot;, \u0027BBC News\u0027, 1 October 2006\u0026lt;/ref\u0026gt;\u0026lt;ref\u0026gt;Ben MacIntyre, \u0027The Last Word: Tales from the Tip of the Mother Tongue\u0027, Bloomsbury (2010), ISBN 9781408804353, [http://books.google.com/books?id\u003dJlJTudVXgI8C\u0026amp;pg\u003dPA48 page 48]\u0026lt;/ref\u0026gt; The first documented usage of the term was in a story about w:Paris Hilton|Paris Hilton published in the \u0027w:New York Post|New York Post\u0027 on 21 January 2006 (\u0026quot;Paris With a P\u0026quot;), which was followed by the second documented usage of the term in another story about Hilton published in the same paper five days later (\u0026quot;Unedited Paris Not Cute at All\u0026quot;).\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A celebrity viewed as unintelligent; especially a celebrity who behaves badly in public\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027, Clayton Neuman, “[http://www.time.com/time/specials/2007/time100walkup/article/0,28804,1611030_1610841_1609853,00.html The Time 100 – Are They Worthy?]” in \u0027w:Time Time\u0027, 17 Apri\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Paris Hilton … helped coin the buzzword \u0027\u0027\u0027celebutard\u0027\u0027\u0027, a cross between \u0027celebrity\u0027 and \u0027retard\u0027. From her sex tapes to having her belongings auctioned on the Web, she seems to totter from one embarrassing moment to another\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, Andrea Peyser, “[http://www.nypost.com/seven/01252009/postopinion/opedcolumnists/celebutards_151694.htm Celebutards: A Pox on All the Celebs and Politicians Gone Wild]” in New York Post\u0027, 25 Januar\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A]t some point between the moment a movie script wanders into the hands of a world-class \u0027\u0027celebutard\u0027\u0027 such as George Clooney, and the words travel through lilting vocal chords and land on unsuspecting ears, something terrible occurs\", \"priority\":5}]}, \"synonyms\":{}}");

