	add("celerity", "{\"term\":\"celerity\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027celeritee\u0027 (compare French \u0027célérité\u0027 , from Latin \u0027celeritas\u0027 from \u0027celer\u0027 (fast, swift)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Speed\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1851\u0027\u0027, Herman Melville, \u0027Moby-Dick\u0027, chapter 48\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The phantoms, for so they then seemed, were flitting on the other side of the deck, and, with a noiseless \u0027\u0027celerity\u0027\u0027, were casting loose the tackles and bands of the boat which swung there\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1937\u0027\u0027, Dorothy L. Sayers, \u0027Busman’s Honeymoon\u0027, chapter 11\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"lt;p\u0026gt;“My parsnip wine is really extra good this year. Dr Jellyfield always takes a glass when he comes—which isn’t very often, I’m pleased to say, because my health is always remarkably good.”\u0026lt;/p\u0026gt;\u0026lt;p\u0026gt;“That will not prevent me from drinking to it,” said Peter, disposing of the parsnip wine with a \u0027\u0027celerity\u0027\u0027 which might have been due to eagerness but, to Harriet, rather suggested a reluctance to let the draught linger on the palate.\u0026lt;/p\u0026gt\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The speed of individual waves (as opposed to the speed of groups of waves\", \"priority\":6}]}, \"synonyms\":{}}");

